import React from 'react'
import { Container ,Row, Col } from 'react-bootstrap'
import { Card } from '@material-ui/core';
import TableInCart from './TableIncart'

export default class CartInCart extends React.Component{
    render(){
        const x= JSON.parse(localStorage.getItem('cartProducts'));
        console.log("in cart.js,,,data==",x);
        console.log("length",x.length);

        return(
            <React.Fragment>
                <Container fluid={true}>
                    <Row>
                        <Col>
                            <Card>
                            <div class="container">
  <h2>Basic Table</h2>
  <p>The .table class adds basic styling (light padding and only horizontal dividers) to a table:</p>            
  <table class="table">
    <thead>
      <tr>
        <th>Product</th>
        <th>Qantity</th>
        <th>Price</th>
        <th>Total</th>
      </tr>
    </thead>

    <tbody>
        {
            (x !== undefined )&&(
                x.map(
                    (val,i)=>{
                        if(i=== 0){
                            let data=val.productDetail
                            console.log("data of first row==",data);
                            return(
                                <tr>
                                <td>img</td>
                            <td>{data.price}</td>
                                <td>john@example.com</td>
                              </tr>
                            )
                        }
                        else{
                            let data1 = val[0].productDetail;
                            console.log(`in ${i} row n data is==`,data1);
                        }

                    }
                )
            )
        }
      <tr>
        <td>John</td>
        <td>Doe</td>
        <td>john@example.com</td>
      </tr>
      <tr>
        <td>Mary</td>
        <td>Moe</td>
        <td>mary@example.com</td>
      </tr>
      <tr>
        <td>July</td>
        <td>Dooley</td>
        <td>july@example.com</td>
      </tr>
    </tbody>
  </table>
</div>
                            </Card>
                        </Col>
                        <Col xs={4}></Col>
                    </Row>

                </Container>
            </React.Fragment>
        );
    }
}
